  return (
    <div>
      Filter
      <FontAwesomeIcon
        icon={faFilter}
        className="icon"
        color="black"
        size="1x"
      ></FontAwesomeIcon>
      <h2>Sort by:</h2>
      <div>Size</div>
      <div>Prize</div>
      <div>id</div>
    </div>
  );
};
export default Filter;
